import React from "react";
import './style.css'

const inputField = () => {
	return (
		<form className="input">
			<input	type="input" 
					placeholder="Enter a task" 
					className="input_box"
			/>
			<button className="input_submit">
				Go
			</button>
		</form>
	);
}

const App:React.FC = () =>
{
	return (
		<div className="App">
			<span className="heading">Todo's</span>
			<inputField/>
		</div> 
		);
}

export default App;
